import React from "react";
import { Card } from "../UI/Card";
import classes from "./UsersList.module.css";

export const UsersList = (props) => {
  console.log(props);
  return (
    <Card className={classes.input}>
      <ul>
        {props.users.map((user) => (
          <li> {user.name}</li>
        ))}
      </ul>
    </Card>
  );
};
